import React from 'react'

function ApplicationPost(prop) {
  return (
    <div className='post'>
        <div className='post__content'>
            <strong>{prop.IDApplication}</strong>
            <strong>{prop.Name}</strong>
            <strong>{prop.StatusHistory[prop.StatusHistory.length-1]}</strong>
        </div>
    </div>
  )
}

export default ApplicationPost
